    def merge_hourly_users(datastore : DatastoreService, merge_into : collection.mutable.Set[Int])
    {
      val query = new Query(FilterNewTracks.hourly_users_key)
      val entities = datastore.prepare(query).asIterable()
      import collection.JavaConverters._
      for {entity <- entities.asScala
           property = entity.getProperty(FilterNewTracks.hourly_users_property)
           user <- property.asInstanceOf[java.util.Collection[Long]].asScala}
      {
        merge_into += user.toInt
      }
    }
    	
    def get_people_to_track(datastore : DatastoreService) : Set[Int] =
    {
      val builder = collection.mutable.Set[Int]()
      builder ++= hardcoded_people_to_track
      merge_hourly_users(datastore, builder)
      builder.toSet
    }
